import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { getUserById, updateUser, deleteUser } from '../services/userService';
import UserForm from '../components/UserForm';
import './UserDetails.css';

const UserDetails = () => {
  const { id } = useParams(); // Get user ID from the route
  const navigate = useNavigate(); // To navigate back to the user list
  const [user, setUser] = useState(null);
  const [isEditing, setIsEditing] = useState(false);

  useEffect(() => {
    // Fetch the user by ID when the component loads
    getUserById(id)
      .then((response) => {
        setUser(response.data);
      })
      .catch((error) => {
        console.error('Error fetching user:', error);
      });
  }, [id]);

  const handleUpdate = (updatedUser) => {
    updateUser(id, updatedUser)
      .then(() => {
        setIsEditing(false);
        setUser(updatedUser); // Update local state
      })
      .catch((error) => {
        console.error('Error updating user:', error);
      });
  };

  const handleDelete = () => {
    deleteUser(id)
      .then(() => {
        navigate('/users'); // Redirect to user list after deletion
      })
      .catch((error) => {
        console.error('Error deleting user:', error);
      });
  };

  if (!user) {
    return <p>Loading...</p>; // Show loading indicator while data is being fetched
  }

  return (
    <div className="user-details-container">
      {!isEditing ? (
        <div>
          <h2>{user.firstName} {user.lastName}</h2>
          <p><strong>Date of Birth:</strong> {user.dateOfBirth}</p>
          <p><strong>Gender:</strong> {user.gender}</p>
          <h4>Identification</h4>
          <p><strong>Number:</strong> {user.identification?.number || 'N/A'}</p>
          <p><strong>Type:</strong> {user.identification?.type || 'N/A'}</p>
          <p><strong>Expiration:</strong> {user.identification?.expiration || 'N/A'}</p>
          <p><strong>Country:</strong> {user.identification?.country || 'N/A'}</p>
          <h4>Vehicle</h4>
          <p><strong>Plate Number:</strong> {user.vehicle?.plateNumber || 'N/A'}</p>
          <p><strong>Type:</strong> {user.vehicle?.type || 'N/A'}</p>
          <p><strong>Make:</strong> {user.vehicle?.make || 'N/A'}</p>
          <p><strong>Model:</strong> {user.vehicle?.model || 'N/A'}</p>
          <p><strong>Year:</strong> {user.vehicle?.year || 'N/A'}</p>
          <button className="btn btn-primary" onClick={() => setIsEditing(true)}>
            Edit
          </button>
          <button className="btn btn-danger" onClick={handleDelete}>
            Delete
          </button>
        </div>
      ) : (
        <UserForm
          initialData={user}
          onSubmit={handleUpdate}
          onCancel={() => setIsEditing(false)}
        />
      )}
    </div>
  );
};

export default UserDetails;
